import React from 'react';
import "./Banner3.css";

export default function Banner3() {
  return (
    <div>
        <div className='banner3-div'>
            <div className='banner3 col-lg-12 col-12'>
                <h2>Shop Adidas <br></br>Originals Sportswear</h2>
                <p className='adidas-text'>Perfect Quality Brand Sport Shoes</p>
                <p className='discover-text'>Discover Now</p>
            </div>
        </div>
    </div>
  )
}
